import React, { useState } from "react"; 

function Form({ quest }){
    const [isChecked, setIsChecked] = useState("") 
    function handleTestInput(e) {
        e.preventDefault();
        setIsChecked(e.target.value)

    }
    return (
        <div>
            <form> {quest.text}
       {quest.options.map(o => 
        <label>{o.text}
             <input
                type="radio" 
                name={quest.id}
                value={o.text} 
                checked={isChecked == o.text}
                 onChange={handleTestInput}></input>

             </label>
         )} 
   </form></div>
    )
}

export default Form;
